Glabridin Glabridino se ituaiga o flavonoids, e maua mai i rhizomes mago o Glycyrrhiza glabra. Ua ta'ua o le "pa'epa'e auro" ona o lona pa'epa'e malosiaafiaga. Glabridin e mafai ona taofia lelei le gaioiga o le tyrosinase, ma faʻafefe ai le gaosiga o le melanin. Ose mea saogalemu, malu fa'apea fo'i ma le aoga o le pa'epa'e malosi. O faʻamatalaga faʻataʻitaʻiga o loʻo faʻaalia ai o le paʻepaʻe o Glabridin e 232 taimi o le vaitamini C, 16 taimi o le hydroquinone, ma le 1164 taimi o le arbutin. Gla
..........
a e toetoe lava tutusa ma le tau o auro. Fua Fa'ainisinia Autu: Galuega: 1. Glabridin e mafai ona paʻepaʻe ma taofia le melanin. 2. Glabridin ei ai aʻafiaga faʻafefe. 3. Glabridin ei ai aafiaga antioxidant. 4. Glabridin e mafai ona tetee lelei siama Talosaga: 1.Glabridin ei ai depigmentation ma meatotino. E taofia ai le gaosiga o le melanin, o le pigmenti e nafa ma le lanu o le paʻu; 2.Studies ua faʻaalia aafiaga lelei i fanua e pei o le LDL(low-density lipoprotein) puipuiga mai le faʻamaʻiina;
